# update pdf displayed on site
def changeRoomPdf(status):
	if status == "firstdraw":
		copyfile("static/liveupdatepdfs/starting.pdf", "static/liveupdatepdfs/howroomsdrew.pdf")
	elif status == "halfway":
		copyfile("static/liveupdatepdfs/halfway.pdf", "static/liveupdatepdfs/howroomsdrew.pdf")
	elif status == "finished":
		copyfile("static/liveupdatepdfs/full.pdf", "static/liveupdatepdfs/howroomsdrew.pdf")
	else:
		copyfile("static/liveupdatepdfs/blank.pdf", "static/liveupdatepdfs/howroomsdrew.pdf")

# parse pdf and update what rooms are taken
def parsePdf():
	# clearRoomStatuses()
	taken_rooms = []
	pdfFileObj = open('static/pdfs/howroomsdrew.pdf', 'rb')

		# creating a pdf reader object
	pdfReader = PyPDF2.PdfFileReader(pdfFileObj)
	num_pages = pdfReader.numPages

	draw_num = 0
	for i in range(num_pages):
	    # creating a page object
	    pageObj = pdfReader.getPage(i)

	    # extracting text from page
	    raw_text = pageObj.extractText()
	    text = re.split('\n', raw_text)

	    for j, line in enumerate(text):
	        if j >= 2 and j<(len(text)-1):
	            # draw time - starting on 1
	            if j %2 == 1:
	                draw_num += 1

	                bldg_key_str = bldg.lower()
	                if len(bldg.lower()) >= 5 and bldg[-5:].lower() == ' hall':
	                    bldg_key_str = bldg_key_str[:-5]
	                if bldg_key_str == "murley-pivirotto":
	                    bldg_key_str = "murley"
	                if bldg_key_str == "forbes college":
	                    bldg_key_str = 'forbes'
	                ''' 
	                if bldg.lower() == 'spelman hall':-
	                  bldg_key_str = 'spelman'
	                if bldg.lower() == 'wilf hall':
	                  bldg_key_str = 'wilf'
	                if bldg.lower() == 'scully hall':
	                  bldg_key_str = 'scully'
	                  '''

	                key_str = bldg_key_str.lower()+room_num.lower()
	                room_id = id_dict[key_str]
	                taken_rooms.append(room_id)

	            if j %2 == 0:
	                split = line.split()
	                room_num = (split[len(split)-1]).lstrip('0')

	                bldg = ""
	                for k in range(len(split)-1):
	                    bldg += split[k]
	                    if k < len(split) - 2:
	                        bldg += " "
	updateTakenRooms(taken_rooms)
